import React from "react";
import ReactDOM from "react-dom";

Nav = () => {
    return (
        <nav>
            <div>Logo</div>
            <ul>
                <li><a>Home</a></li>
                <li><a>About</a></li>
                <li><a>Pricing</a></li>
                <li><a>Solutions</a></li>
                <li><a>Contact</a></li>
            </ul>
        </nav>
    )
}

export default Nav;
